import './aboutProject.scss'
function AboutProject (){
    return (
        <section className="aboutProject">
            <h1 className='aboutProject__title'>О проекте</h1>
            <div className='aboutProject__info'>
                <div className='aboutProject_texts'>

                  <h2 className='aboutProject__header'>Дипломный проект включал 5 этапов</h2>
                  <p className='aboutProject__about'>Составление плана, работу над бэкендом, вёрстку, добавление функциональности и финальные доработки.</p>
                  </div>
                <div className='aboutProject__timeline'>


                </div>

            </div>

        </section>
    );
}

export default AboutProject;
